#
#
# # EMOJI_READY
#   dead_doubleacute *dead_reversed
#
#   This virtual dead key was added when live key support for a set of emoji
#   was added on Windows in the wake of implementing one more extra modifier
#   as a counterbalance to the misdesigned dead key support on Windows.
#
#   These emoji add to the cross-platform compatible set supported on the basic
#   keyboard layout.
#
#   The rationale for this pick is ergonomics paired with alphabetic mnemonics.
#   First of all, the dead key chord should encompass 2 dead keys next to each
#   other, that are not usually associated in dead key chains. Additionally,
#   the pair should be mnemonic. This works based on "emoji", with the default
#   mapping of dead_doubleacute on key D03 "E", and "reversed", *dead_reversed
#   being on key D04 "R". Hence an easy (order insensitive) combination.
#
#   This subsection was moved here after its then-66kB brought compose-2.yml to
#   the brink of oversize under the GitHub 2MB file size restriction for the
#   use of its web interface on github.com (not on github.dev).
#
#   The base characters are ordered following the ASCII map of the keyboard
#   layouts, stable across all locale variants and remapped variants, rather
#   than by code point, and the aliases are ordered below the ASCII character
#   they stand for: EuroSign for quotedbl, periodcentered for backslash,
#   dead_greek for at, rightsinglequotemark for apostrophe, section for exclam.
#   This order consistent with the actual user experience is most beneficial
#   for development and maintenance.
#   See # # Proposed dead key layout for AZERTY keyboards
#   See #   Dead key layout overview
#
