#
#
#
#   START_GROUP_DEAD_KEY
#
#
### Group dead key introduction
#
#   The group dead key is a special dead key designed to remap every single key
#   position. E.g. group 1 of "", "", "", "帽", SOFT HYPHEN and NON-BREAKING
#   HYPHEN outputs "" U2015 HORIZONTAL BAR, a feature designed for African and
#   Breton variants and as a fallback.
#   See # # HORIZONTAL BAR for Breton and African variants
#   See # # Fallback input methods for HORIZONTAL BAR
#
#   Usually, however, the scope of the group dead key is limited to a handy set
#   of base characters including the Latin base alphabet, the 10 digits and the
#   set of ASCII symbols mapped at level 3 as of 30 symbols, and at level 1 as
#   of period and comma, plus ordinary space and common no-break space.
#
#   The resulting letter groups and symbol groups make up the main content of a
#   standard group dead key as used on this keyboard layout, with support for a
#   minimum number of 4 multiple presses. Support for looping through the group
#   array is straightforward on macOS with the terminator showing the currently
#   active group, and on Windows. In XCompose, supporting the first four groups
#   by multiple presses is feasible, and going beyond is not even desirable, as
#   all groups  except group 1 and group 2  are activatable by typing a digit
#   after pressing the group dead key. This scheme expands the group array to a
#   total number of 12 groups accessed using the group dead key, piling up upon
#   the default group, that is obiously numbered 0, contrasting with the scheme
#   introduced by ISO/IEC 9995.
#
#   ASCII symbols and punctuation, space, no-break space:
#   See ### Space and symbol groups
#
#   Latin base alphabet:
#   See ### Letter groups
#
#   Digits and non-ASCII base characters:
#   See #*# GROUP_1
#   See #^# GROUP_2
#   See #^# GROUP_3
#   See #^# GROUP_4
#   See #^# GROUP_5
#   See #^# GROUP_6
#   See #^# GROUP_7
#   See #^# GROUP_8
#   See #^# GROUP_9
#   See #^# GROUP_10
#   See #^# GROUP_11
#   See #^# GROUP_12
#
#   The keysym *dead_group is not supported in keysymdef.h. For the time being,
#   the private use character UEFB0 is used as the group dead key.
#
#
# # History
#
#   The group dead key has been introduced by Karl Pentzlin implementating the
#   new DIN 2137-2:2012 standard on Windows. Noticing that Windows-style layout
#   drivers cannot support the ISO/IEC-9995-style group dead key, Karl Pentzlin
#   moved the group dead key to a real dead key emulating the dead key behavior
#   that ISO/IEC 9995 specified for the level-2 modifier + level-3 modifier key
#   combination.
#
#   A similar dead key included in other keyboard layouts may be called Latin
#   and punctuation as on the French ergonomic b茅po keyboard layout in annex B
#   of NF Z71-300:2019, or Europe as in annex A, worded Caract猫res europ茅ens
#   additionnels in Microsofts implementation ("Caract篓res europ漏ens
#   additionnels").
#   https://kbdlayout.info/kbdfrna/download/klc
#   https://bepo.fr/wiki/Latin_et_ponctuation
#
#   XKB supports the ISO/IEC 9995 conformant group selection since 2013.
#   https://bugs.freedesktop.org/show_bug.cgi?id=60991
#
#   Virtual dead keys accessed by multiple dead key presses in turn have been
#   introduced by the b茅po development team in 2015, while upgrading the b茅po
#   layout to version 1.1 for the NF Z71-300:2019 keyboard layout standard.
#
#
# # Numbering
#
#   For UX consistency, the default group is group 0. Therefore, the numbering
#   scheme specified in ISO/IEC 9995 is ruled out in favor of a zero-based one.
#   Only groups accessed by the group dead key are numbered starting
#   with 1, because a group accessed by an n-uple press on the group dead key
#   must be called group n rather than group n+1. The ISO/IEC 9995 standard
#   uses 1-based numbering because it uses the terms primary and secondary
#   with respect to groups, and fails to consider dead key based group
#   selection with support for multiple presses.
#
#   As a short identifier for "group #", "g#" is proposed.
#
#
# # Cross-platform compatibility
#
#   Implementing the group selector as a dead key rather than a modifier key
#   avoids breaking user experience across platforms, since Windows unsupports
#   the ISO group selector modifier key combination Shift + AltGr, but supports
#   6 + 1 modifiers, and Apple has broken its technote TN2056 around 2015 after
#   previously allowing to use left Option as an extra modifier, that was
#   effectively used by the German Neo ergonomic keyboard layout. After the
#   dedicated left Option was broken, Neo emulated left Option using
#   Takayama Fumihikos Karabiner Elements.
#   https://pqrs.org/osx/karabiner/
#
#
# # Maintenance of letter groups
#
#   While fully allocating symbol groups is a straightforward design decision,
#   letter groups do have unused slots. Filling these with null output "" U0000
#   or the respective group number could be avoided for ease of maintenance.
#
#   However, for clarification with respect to combining diacritics, the group
#   number or its unity (as of group 11, for cross-platform compatibility) is
#   output in the few empty instances in groups 3..5, 11, without mention in
#   the documentation. To achieve this, the keyword "available" must be present
#   in the EOL comment of these instances.
#   See [] # Available.
