#   given a similar facility, and the multicharacter strings of spaced-out
#   guillemets with an NBTSP inside (after/before) are supported, too. So is
#   the pound sign on key D12 based on the greater-than* single angle quotation
#   mark "" U203A, while the nearby diaeresis gets its spacing clone only, for
#   feasability on XCompose not supporting chained dead keys. The asciicircum,
#   dollar sign and generic currency sign as printed on keycaps are supported
#   altogether, and even the equals sign on E12 and the ampersand on E01. But
#   it stops here, and this fully works on unremapped layouts only, assuming
#   that remapping defeats the point in backward compatibility anyway.
