#   The FIGURE DASH is a tabular minus sign used in typesetting tables, not in
#   interval notation, although it was recommended for that purpose.
#   https://web.archive.org/web/20210224183416/http://www.technicalauthoring.com/wiki/index.php/Figure_dash
#
#   Since FIGURE DASH occurs in single instances only, it is compatible with
#   dead key input, unlike FIGURE SPACE and PUNCTUATION SPACE that are the
#   tabular digit and punctuation spaces, respectively, and are mapped on live
#   keys B07 (digitspace) and B08 (punctspace), level 7, in ASCII mode.
#
#   FIGURE DASH is not supported on live key to prevent its misuse for interval
#   notation, a use case that "" U2013 EM DASH is recommended for, as vertical
#   alignment issues are to be handled at font level.
#   https://www.unicode.org/versions/Unicode15.0.0/ch06.pdf#G6120
#   https://en.wikipedia.org/wiki/Dash#Figure_dash
#   https://en.wikipedia.org/wiki/Dash#En_dash
#   https://en.wikipedia.org/wiki/Dash#Unicode
#   https://web.archive.org/web/20180121071439/http://www.technicalauthoring.com/wiki/index.php/Figure_dash
#
#   Unicode does not promote the misuse of FIGURE DASH for interval notation as
#   advocated on the web page cited above, but Unicode did  and still does 
#   promote the misuse of FIGURE SPACE as a numeric group separator, in UAX#14.
#   https://www.unicode.org/reports/tr14/tr14-51.html#NNBSPdoc
