#
#
# # Arrows as on the numpad
#
#   These are needed to palliate a lack of the dedicated or integrated numpad.
#
#   Five sets of arrows and ten arrow emoji have an input method using digits
#   0..9 in groups 2..7. The digits are based on the position of cursor arrows
#   on the numpad on keys 2, 4, 6, 7 and 8. The remaining single headed arrows
#   are extrapolated; double-headed left-right is placed on 5, up-down on 0.
#
#   The arrow emoji are heterogeneous in that the cardinal arrows are plain
#   arrows ("猬" U2B05 LEFTWARDS BLACK ARROW and 3 others), whereas the diagonal
#   and bidirectional arrows are picked from the basic arrows. For a consistent
#   user experience, this mix makes up an extra set.
#   See # # Arrow emoji
#
#   Group 1 is not used here, since digits in group 1 are dead keys activating
#   other groups. And groups 8 and 10 are used for mathematical digit symbols:
#   double-struck (U1D7D8..) and sans-serif (U1D7E2..).
#
#   So, groups 9, 11 and 12 are used for additional arrow sets: triangle-headed
#   to bar (U2B70..) as of BMP arrows, and the wide-headed light (U1F860..) and
#   very heavy (U1F880..) in the SMP. The sans-serif set U1F850.. is skipped as
#   not providing enough added value with respect to the fact that on Windows,
#   the DEADTRANS macro only supports one single code unit output instead of 2,
#   5 or more, and as a consequence, SMP characters are hard to input by dead
#   keys.
#
#   0 and 5 are used to input the high surrogate, thanks to the fact that these
#   arrows do not include bidirectional, double-headed arrows pointing in
#   opposite directions.
#
#   The numpad live key level depends on the Mode Lock toggle state.
#
#
#   Group  Description                         Example   Numpad live key level
#
#       2  Basic simple arrows                  U2191   AltGr or AltFr
#       3  Basic double arrows                  U21D1   Shift + (AltGr or AltFr)
#       4  Arrow emoji (mix of filled and simple arrows) AltFr or AltGr + AltFr
#       5  Filled (black) arrows             猬 U2B06   Shift + (AltGr +) AltFr
#       6  Outline (white) arrows             U21E7   Shift + AltGr (+ AltFr)
#       7  Triangle-headed arrows              猸 U2B61   AltGr + AltFr or AltGr
#       9  Triangle-headed arrows to bar       猸 U2B71
#      11  Wide-headed light barb arrows       　 U1F861
#      12  Wide-headed very heavy barb arrows   U1F881
#
#
#^# GROUP_2
