#
#
### Space and symbol groups
#
#   The base characters in this section are mapped on AltGr/Option or unshifted
#   keys as of comma, period and space. Symbols and punctuation mapped at
#   level 3 assume using the group dead key in synergy on AltGr/Option.
#
#   Consistently, this section is ordered by keys rather than by groups, while
#   each one of the 32 ASCII symbols supports the 12 groups.
#
#   Mnemonics use either the ASCII symbols or the letters of the base alphabet.
#   Accordingly, the ASCII symbols are not meant to be printed on the keycaps.
#
#
# # Math symbols in symbol groups
#
#   Mathematical symbols outside the math section, in the dead key section and
#   especially in the symbol groups, are labeled as "math", because this label
#   is converted to link text, with a hyperlink to the first instance of that
#   symbol on the math symbols page, on the condition that the "math" string is
#   appended as the very last element.
#
#   Non-math characters, such as the letter pi and the envelope emoji, are also
#   given this "math" label, as far as a multikey sequence in the math section
#   is available for input. This "math" label is therefore more of a UX feature
#   than of an information about the "Math" status.
#   See ### Mathematical symbols by multikey
#
#
# # Emoji in symbol groups
#
#   Supporting all emoji in the Basic Multilingual Plane except Chinese letter
#   emoji makes sense because input by dead keys is cross-platform compatible,
#   whereas SMP emoji are excluded from this scheme because of cross-platform
#   incompatibilities due to design mistakes in Windows, where keyboard layouts
#   have been coded by a single developer whose errors persistently degraded
#   the usability of most of the worlds computers.
#
#   A number of BMP emoji are supported alternatively or only elsewhere:
#
#       * See #^# Abbreviations, Units and Legal Symbols
#       * See #^# Western Zodiacal Signs
#       * See #^# Emoji by multikey
#       * See # # Arrow emoji
#
#   A number of Supplemental Multilingual Plane emoji are mapped on live keys.
#
#   The two emoji-related variation selectors are in group 10 on key E, D03,
#   for emoji style, VS16 UFE0F, and on key T, D05, for text style, VS15 UFE0E.
#
#   The five emoji skin tone modifiers based on the 6-shades Fitzpatrick scale
#   "" U1F3FB, "" U1F3FC, "" U1F3FD, "" U1F3FE, "" U1F3FF are discontinued
#   as inappropriate on a general-purpose keyboard layout without extensive
#   emoji support.
#
#   Colorful emoji lists:
#   https://unicode.org/emoji/charts/emoji-list.html
#   https://unicode.org/emoji/charts/full-emoji-list.html
#
#   Plain text emoji list:
#   https://unicode.org/Public/emoji/latest/emoji-sequences.txt
#   This list is abbreviated. Contiguous code points are replaced with ranges.
#   As a consequence, searchability is limited.
#
#   Specification:
#   https://unicode.org/reports/tr51/
#
#   Frequency:
#   https://home.unicode.org/emoji/emoji-frequency/
#   https://www.futurity.org/emoji-countries-1328712-2-2/
#
#
# # Extra symbol group
#
#   Three symbols, namely dollar, asciitilde and grave, have an extra group for
#   the emoji "" U2600, "" U2620 and "" U2744, respectively, As these are in
#   the BMP, they benefit from the full-support policy. All need a disclaimer.
#   While the scull-and-crossbones emoji is intrinsically prone to misuse after
#   its assumed original intent to warn against life threats through poisons,
#   sun and snowflake are basically inoffensive, but these are hijacked, due to
#   their "black" text representation as of the sun, or due to the emoji status
#   and subsequent availability on devices. Against this there is no safeguard,
#   but for the sun, a possible solution is to use the white sun for the emoji.
#   See # # Sun emoji
#   See # # C02 dollar
#   See "" U263C
#   See # # Skull and crossbones emoji
#   See # # D05 asciitilde
#   See "" U2625
#   See # # Snowflake emoji
#   See # # B06 grave
#   See "" U2746
#
#   The triggering character is ellipsis, typed right before the base character
#   and right after the group dead key or its multikey equivalent; 芦娄#$禄 for
#   "" U2600, 芦娄#~禄 for "" U2620, 芦娄#`禄 for "" U2744.
#
#   In French, this extra group is called "groupe 1 bis", with a Latin word for
#   "twice", in English "group 1a". Consistently, in this code, the extra group
#   comes after group 1, with "<ellipsis>" prepended to the base character.
#
#   Both glyphs and shapes may not match exactly, as opposed to the character
#   names. In any event, safety goes first, in order to make this project more
#   resilient against suspicions about fostering the input of either disguised
#   or explicit symbols related to ideologies or practices that are firmly
#   rejected and condemned.
#   https://en.wikipedia.org/wiki/Black_Sun_(symbol)
#   https://de.wikipedia.org/wiki/Schwarze_Sonne
#   https://fr.wikipedia.org/wiki/Soleil_noir_(symbole_occulte)
#   https://www.lemonde.fr/societe/article/2025/02/15/le-neonazisme-en-france-une-menace-diffuse-et-hybride_6548247_3224.html
#   https://www.francetvinfo.fr/replay-radio/le-choix-franceinfo/pizza-pilule-bleue-ou-rouge-c-ur-violet-le-sens-cache-de-ces-emojis-que-vous-utilisez-souvent-sur-les-reseaux-sociaux_7130340.html
