# # D01 asciicircum
#
#   "陋" U00AA FEMININE ORDINAL INDICATOR is a legacy character, superseded by
#   the use of preformatted superscript small letters. This new, regular scheme
#   supports also French, and plural forms, additionally to singular forms, and
#   to Italian, Portuguese, Spanish. As a result, the legacy scheme turns out
#   to be a partial solution designed for limited character sets. Sticking with
#   it in the Unicode era, using live key positions and premium dead key slots,
#   would be utterly inadequate. Instead, legacy ordinal indicators are placed
#   here in symbol group 12 consistently with "a" and "o" and are additionally
#   supported by multikey.
#   See #^# Legacy ordinal indicators
#   See # # D09 braceright
#
