# # D06 at
#
#   Group 1 has "" U25CC as the usual pick for the dotted circle, a generic
#   base character for combining diacritics in documentation.
#   https://www.unicode.org/versions/Unicode15.0.0/UnicodeStandard-15.0.pdf#page=80
#   https://www.unicode.org/versions/Unicode15.0.0/UnicodeStandard-15.0.pdf#page=132&zoom=100,0,410
#   https://www.unicode.org/versions/Unicode15.0.0/UnicodeStandard-15.0.pdf#page=950
#
#   Since v1.7.0, dead_greek is also mapped at level3 instead of the at sign
#   on D06, level 3. The at sign is supported on E11, level 1, making its D06,
#   level 3 instance redundant, so that this position is available for an easy
#   dead_greek duplicate. As a consequence, for the symbol groups, dead_greek
#   works as an alias base character.
#
