#   consistent with mainstream practice, the pick for the intended level-3
#   bullet is "" U2023, consistently with its triangular shape, with the group
#   number, and with the Unicode scalars. The usual level-3 bullet "" U25AA is
#   an emoji, and as such it is supported group 4 of numbersign as part of a
#   set of four emoji.
#   See # # C01 numbersign
#
#   Default HTML-CSS bullets are often associated with Unicode characters
#   "" U2022 for level 1 "list-style-type: disc", and "" U25E6 for level 2
#   "list-style-type: circle".
#
#   The bullet for level 3 and below is usually "list-style-type: square", and
#   the official square bullet per the Unicode Standard is "" U25AA, an emoji
#   supported in group 4 of numbersign as part of a set of four square emoji.
#   https://www.unicode.org/charts/nameslist/n_25A0.html
#   See # # C01 numbersign
#
#   Browsers may display "" U25AA smaller than CSS "list-style-type: square".
#   In case it is still considered too big as a lower-level bullet, there is
#   also "猬" U2B1D BLACK VERY SMALL SQUARE, eventually somewhat confusable with
#   "路" U00B7 MIDDLE DOT. "猬" U2B1D is supported here, in group 4, alongside
#   "" U2023 TRIANGULAR BULLET in group 3 as an interesting alternative, while
#   "" U2043 HYPHEN BULLET is in group 1 of minus.
#   See # # C05 minus
#
#   The rationale for supporting bullets in the groups of underscore is based
#   on alphabetic mnemonics when underscore was on C09 "L", level 3, but it has
#   vanished when underscore moved to C07 "J" in the wake of making room for
#   EuroSign on D03 "E", level 3 (requiring the braces to move to "I" and "O"
#   for ergonomics, and the brackets to move to "K" and "L" for consistency).
#   Still, even after the move, underscore remains the only option for bullets
#   in the symbol groups, additionally to bullets by multikey.
#   See #^# Bullets
#
