#
#
# # A03-level_1 space
#
#   ISO A03 should be the left Thumb Shift (Oyayubi Shifuto).
#   https://web.stanford.edu/class/cs140/projects/pintos/specs/kbd/scancodes-7.html
#
#   U200B ZERO WIDTH SPACE has an alternate, more intuitive and more familiar
#   acronym: WNJ, for WORD NON-JOINER.
#   https://unicode-org.atlassian.net/browse/CLDR-16631?focusedCommentId=169819
#   https://www.unicode.org/mail-arch/unicode-ml/y2007-m11/0119.html
#   https://github.com/unicode-org/cldr/blob/2b08423c8502f499b334eef17488c730adcd3a6c/tools/cldr-code/src/main/java/org/unicode/cldr/util/CodePointEscaper.java#L32
#   https://github.com/unicode-org/cldr/blob/main/tools/cldr-code/src/main/java/org/unicode/cldr/util/CodePointEscaper.java#L32
#
#   U200B ZERO WIDTH SPACE also has an intuitive, to-the-point French name:
#   CSURE CONDITIONNELLE, break opportunity. In Latin script, it is useful in
#   long URLs expected to line-wrap after slashes but not doing so in not fully
#   Unicode conformant browsers.
#   https://www.unicode.org/versions/Unicode15.0.0/UnicodeStandard-15.0.pdf#page=944
#   https://unicode.org/reports/tr14/#SY
#
#   This WNJ is also on live key, level 4 of the space bar.
#   See dispocla.cpp ## Format controls
#   See dispocla.cpp key <SPCE>
#
#   U2002 and U2003 are at level 1 for usability, although these spaces were
#   originally intended to be no-break. That brings the need to move their two
#   breaking clones "" U2000, "" U2001 to A03-level_3, since these have been
#   made canonically equivalent, as part of mitigating the mess left by the
#   typographical space range vandalization; U2002..U2006 and U2008..U200A were
#   originally intended to be no-break, just like U2007 FIGURE SPACE ultimately
#   remained, as sort of the sole survivor.
#   See # # Punctuation spacing for French, regular with U202F NBTSP
#
#   Unlike stated in UAX #14, U2007 is not intended for use in numbers, but
#   before numbers for indentation in tables. Therefore, it is also called
#   tabular digit space, as opposed to the tabular punctuation space U2008.
#   https://www.unicode.org/reports/tr14/tr14-53.html
#   https://www.unicode.org/reports/tr14
#
